month = 1 - 1

def fun(x,y):
    a = []
    for j in y[:, 0]:
        b = []
        for i in x[0]:
            if matrix[month, (70-i)//2,  (20+j)//2] != None:
                b.append(float(matrix[month, (70-i)//2,  (20+j)//2]))
            else:
                b.append(0)
        a.append(b)
    return np.asarray(a)

x = np.arange(48, 72, 2, dtype = np.int32) # latitude size 12 / 2 []
y = np.arange(-20, 10, 2, dtype = np.int32) # longitude size 15/ -1 []
X, Y = np.meshgrid(x, y)

plt.contour(Y, X, fun(X, Y), 8, cmap=plt.cm.hot)
C = plt.contour(Y, X, fun(X, Y), 8)
plt.clabel(C, inline=True, fontsize=12)
plt.show()